import React, {Component} from 'react';
import AboutUi from "./AboutUI";
import Topsells from "./Topsells";

class Ui extends Component {
    render() {
        return (
            <div>
                <AboutUi/>
                <Topsells/>
            </div>
        );
    }
}

export default Ui;
